CREATE TYPE "public"."Gender" AS ENUM ('MEN', 'WOMEN', 'KID', 'UNISEX');

-- Table Definition
CREATE TABLE "public"."Footwear" (
    "id" text NOT NULL,
    "title" text NOT NULL,
    "description" text NOT NULL,
    "price" float8 NOT NULL DEFAULT 0,
    "slug" text NOT NULL,
    "tags" _text DEFAULT ARRAY[]::text[],
